import serviceIcon1 from "assets/images/service/service-icon-1.svg";
import serviceIcon2 from "assets/images/service/service-icon-2.svg";
import serviceIcon3 from "assets/images/service/service-icon-3.svg";
import serviceIcon4 from "assets/images/service/service-icon-4.svg";
import firstLama from "assets/images/service/1.png";
import secondLama from "assets/images/service/2.png";
import thirdLama from "assets/images/service/3.png";
import fourthLama from "assets/images/service/4.png";

export default {
  services: [
    {
      icon: firstLama,
      title: "Marketing",
      body: "The company will provide an end-to-end marketing solution for its partners and clients.",
    },
    {
      icon: secondLama,
      title: "Lounges",
      body: "A new lounge concept aims to provide a comfortable place for investors, developers, etc",
    },
    {
      icon: thirdLama,
      title: "Technology",
      body: "In-house developers will develop fully scalable and digitally solution",
    },
    {
      icon: fourthLama,
      title: "Ventures",
      body: "Investing in other businesses to boost its revenue and create more opportunities.",
    },
  ],
};
